=encoding utf8

=head1 Hex Describe

Hex Describe is a web application which uses recursive random tables to create
the description of a map. A map in this context is a hex map. This is different
from other such tools like Tracery because a collection of locations on a maps
differ from a list of unrelated items. Neighbouring locations can share features
and thus a river can flow through many locations, a forest can cover many
locations, and so on.

On a technical level, Hex Describe is a web app based on the Mojolicious
framework. This is the biggest dependency. It uses Modern::Perl to enable
additional features of Perl and the CPAN. Array::Utils is useful for list
manipulations.

=cut

use Modern::Perl;
use Mojolicious::Lite;
use Mojo::UserAgent;
use Mojo::URL;
use Mojo::Log;
use Mojo::File;
use Mojo::Util qw(html_unescape url_escape);
use Mojo::ByteStream;
use Array::Utils qw(intersect);
use Encode qw/decode_utf8/;
use Text::Autoformat;

=head2 Configuration

As a Mojolicious application, it will read a config file called
F<hex-describe.conf> in the same directory, if it exists. As the default log
level is 'debug', one use of the config file is to change the log level using
the C<loglevel> key, and if you're not running the server in a terminal, using
the C<logfile> key to set a file.

The default map and table are stored in the F<contrib> directory. You can change
this directory using the C<default_dir> key. This is necessary when using
Toadfarm to run the application, for example.

    {
      loglevel => 'debug',
      logfile => 'hex-describe.log',
      default_dir => '/home/alex/farm/contrib',
    };

=cut

plugin Config => {default => {
  loglevel => 'debug',
  logfile => undef,
  default_dir => 'contrib', }};

my $log = Mojo::Log->new;
$log->level(app->config('loglevel'));
$log->path(app->config('logfile'));

=head2 Default Map, Default Table

The code comes with a default map created using Text Mapper's Alpine algorithm,
and a default table. In fact, most of the actual effort went into this default
table. In order to understand how the table actually gets used, you should
probably read the tutorial.

=cut

my $dir = app->config('default_dir');
my $default_map = Mojo::File->new("$dir/hex-describe-default-map.txt");
my $schroeder_table = Mojo::File->new("$dir/hex-describe-schroeder-table.txt");
my $seckler_table = Mojo::File->new("$dir/hex-describe-seckler-table.txt");
my $strom_table = Mojo::File->new("$dir/hex-describe-strom-table.txt");
my $johnston_table = Mojo::File->new("$dir/hex-describe-johnston-table.txt");
my $traveller_table = Mojo::File->new("$dir/hex-describe-traveller-table.txt");

=head2 URLs

The code needs to know where Text Mapper and the Face Generator can be found.

=cut

my $hex_describe_url = app->config('hex_describe_url') || 'https://campaignwiki.org/hex-describe';
my $text_mapper_url = app->config('text_mapper_url') || 'https://campaignwiki.org/text-mapper';
my $face_generator_url = app->config('face_generator_url') || 'https://campaignwiki.org/face';

=head2 Entry Points

As this is a web app, the URLs you can call are basically the API it exposes.
Each URL can accept either I<get> or I<post> requests, or I<any>.

=over 4

=item get /

The default entry point is where you I<edit> your map and table. B<map> is the
map, B<url> is the URL to an external table, B<table> is the text of the table
if you want to paste it. See C</describe> below if you want to display the
result instead of allow the user to edit the form.

=cut

get '/' => sub {
  my $c = shift;
  my $map = $c->param('map') || decode_utf8($default_map->slurp);
  my $url = $c->param('url');
  my $table = $c->param('table');
  $c->render(template => 'edit', map => $map, url => $url, table => $table);
} => 'edit';

