@@ hex-describe.css
body {
  padding: 1em;
  font-family: "Palatino Linotype", "Book Antiqua", Palatino, serif;
  max-width: 80ex;
}
.spell, .caster {
  color: inherit;
}
textarea {
  width: 100%;
}
table {
  width: 100%;
  white-space: nowrap;
  border: 1px solid #696969;
  border-collapse: collapse;
}
tr.head {
  background-color: #ccc;
  font-weight: bold;
}
tr.odd {
  background-color: #eee;
}
tr.even {
}
tr.end {
  font-weight: bold;
  background-color: #ccc;
}
td, th {
  padding: 5pt 5pt 2pt 5pt;
  text-align: left;
}
.center, tr.end * {
    text-align: center;
}
.example {
  font-size: smaller;
}
.images img.portrait {
  max-width: 80px;
}
.images img.landscape {
  max-width: 120px;
}
.images img.map {
  width: 30ex;
}
.images {
  clear: both;
  float: right;
}
.coordinates a {
  color: inherit;
}
@media screen and (min-width: 110ex) {
  .sidebar {
    position: absolute;
    max-width: 30ex;
    left: 90ex;
  }
}
.sidebar {
  width: auto;
  border: none;
}
.sidebar tr {
  font-size: smaller;
}
.sidebar td {
  text-align: center;
}
.treasure {
  background-color: #fffacd;
  padding: 2px 1px 0px 1px;
}
.river {
  background-color: #e0ffff;
  padding: 2px 1px 0px 1px;
}
.trail {
  background-color: #f5f5dc;
  padding: 2px 1px 0px 1px;
}
.forest {
  background-color: #c1ffc1;
  padding: 2px 1px 0px 1px;
}
.grass {
  background-color: #f2ffe6;
  padding: 2px 1px 0px 1px;
}
.mountains {
  background-color: #e0e0e0;
}
blockquote {
  border-left: 3px solid grey;
  padding-left: 1ex;
  margin: 0;
}
hr {
  clear: both;
}

